import { useContext, useEffect, useState } from "react";
import axios from "axios";
import styled from 'styled-components';

function MetaSearch() {


    return (
        <div>
            <ResultWrap>
                <h2>검색 결과</h2>
            </ResultWrap>
        </div>
    );
}

const ResultWrap = styled.div`
    flex: 1;
    display: flex;
    flex-direction: column; 
    overflow-y: auto;
    position: relative;
    margin-top:20px;
`;

export default MetaSearch;
